def tracert():
    import time
    num_sites_to_check = int(input('Сколько сайтов вы хотите проверить: '))
    russia_sites = []

    for _ in range(num_sites_to_check):
        user_input = input('Введите адрес сайта для проверки: ')
        russia_sites.append(user_input)

    russia_status = {}

    for site in russia_sites:
        print('Проверка сайта...\n')
        cls()
        print('Проверка доступа к сайту(ам)....\n')
        result = os.system("tracert -w 1 " + site)
        if result == 0:
            russia_status[site] = f"{Fore.GREEN}да{Fore.WHITE}"
        else:
            russia_status[site] = f"{Fore.RED}нет{Fore.WHITE}"
    cls()
    for i in range(1):
        print("Доступ к сайтам:\n")
    for site, status in russia_status.items():
        print(site + ":", status)
    input()

