string Test(int first, int second)
{
    if (second == 0) {  return "Деление на 0!"; }

    int res = first % second;

    if (res == 0)
    {
        return "Да";
    }
    else
    {
        return $"Нет, {res}";
    }
}

Console.WriteLine(Test(10,0));

string Test(int num)
{
    if (num > 999)
    {
        while (num > 999)
        {
            num = num / 10;
        }
        return $"{num % 10}";
    }
    else
    {
        return "Третьей цифры нет";
    }
}

